  `buy_condition` varchar(255) NOT NULL COMMENT '买入条件',
  `sell_condition` varchar(255) NOT NULL COMMENT '卖出条件',
  `dateline` int(11) NOT NULL COMMENT '发布时间',
  PRIMARY KEY (`gid`)
